	// 申请入门，只有人脸注册的人才可以通过人脸识别进入，接口给进门的人脸识备使用
	@RequestMapping(value = "/enter")
	@ResponseBody
	public String enter(String personId) {
		// 车子落架
		System.out.println("车辆所在层已经放到地面，可以进行取车！");
		try {
			// 开门
			CloseableHttpClient httpclient = HttpClients.createDefault();
			HttpPost httpPost = new HttpPost(IN_URL + "/device/openDoorControl");
			httpPost.setHeader("Content-Type", "application/x-www-form-urlencoded");
			List<NameValuePair> nvps = new ArrayList<NameValuePair>();
			nvps.add(new BasicNameValuePair("pass", "88888888"));
			httpPost.setEntity(new UrlEncodedFormEntity(nvps));
			httpclient.execute(httpPost);
		} catch (Exception e) {
			e.printStackTrace();
		}
		return SUCCESS_RESULT;
	}

	// 出门结账，通过人脸识别生成账单，接口给出门的人脸设备使用
	@RequestMapping(value = "/bill")
	@ResponseBody
	public String bill(String personId) {
		// 费用记录
		ParkPayRule ppr = parkPayRuleService.get("1");
		ParkPay pp = new ParkPay();
		ParkOrder po = new ParkOrder();
		po.setPersonId(personId);
		List<ParkOrder> list = parkOrderService.findList(po);
		ParkOrder parkOrder = list.get(0);
		parkOrder.setEndTime(new Date());
		parkOrder.setStatus("1");
		parkOrderService.save(parkOrder);
		
		pp.setFloor(parkOrder.getFloor());
		pp.setRemarks("0");
		pp.setJiffyStand(parkOrder.getJiffyStand());
		pp.setPersonId(parkOrder.getPersonId());
		pp.setStartDate(parkOrder.getStartTime());
		pp.setEndDate(parkOrder.getEndTime());
		long times = pp.getEndDate().getTime() - pp.getStartDate().getTime();
		pp.setCost(
				(int) (times / (Integer.valueOf(ppr.getPeriod()) * 60000) + 1) * Integer.valueOf(ppr.getPrice()) + "");
		parkPayService.save(pp);
		return SUCCESS_RESULT;
	}

	@RequestMapping(value = "/test")
	@ResponseBody
	public String test(String personId, String deviceKey, String ip) {
		Map<String, Object> map = new HashMap<String, Object>();
		map.put("personId", personId);
		map.put("deviceKey", deviceKey);
		map.put("ip", ip);
		System.out.println(map);
		CloseableHttpClient httpclient = HttpClients.createDefault();
		HttpPost httpPost = new HttpPost("http://192.168.4.105:8090/changeLogo");
		httpPost.setHeader("Content-Type", "application/x-www-form-urlencoded");
		String result = "";
		CloseableHttpResponse response = null;
		try {
			// 参数设置
			List<NameValuePair> nvps = new ArrayList<NameValuePair>();
			nvps.add(new BasicNameValuePair("pass", "88888888"));
			nvps.add(new BasicNameValuePair("imgBase64",
					""));
			httpPost.setEntity(new UrlEncodedFormEntity(nvps));
			response = httpclient.execute(httpPost);
			HttpEntity entity = response.getEntity();
			result = EntityUtils.toString(entity);
			System.out.println(result);
		} catch (ClientProtocolException e) {
			logger.error("http协议异常：" + e.getMessage());
		} catch (IOException e) {
			logger.error("http读取异常：" + e.getMessage());
		} catch (Exception e) {
			logger.error("httpException：" + e.getMessage());
		} finally {
			try {
				response.close();
			} catch (IOException e) {
				logger.error("http输出流关闭错误：" + e.getMessage());
			}
		}

		return "{\"result\":1,\"success\":true}";
	}

